description:
This is the E-UAE Commodore Amiga Emulator with the following extras



- Kick ROM 1.3, 2.0 and 3.0

- E-UAE Version for i386 from interceptor

- E-UAE UB Version from weichert

- Hi-Toro Configuration File creator for E-UAE

- sdl.framework for Mac OSX

- Games: New Zealand Story, Pac Mania, Pinball Fantasies, Rainbow Island, Speedball 2, Superfrog



I created a configuration file, that is setup for my machine, to run the emulation properly. please adjust the following setting in &quot;default.uaerc&quot;: 



gfx_framerate=15



set it to a lower number, if the emulator drops too much frames.

this emulator runs better under ppc, also some games strangely just run with the ppc version (such as pac mania)



drop comments if you have additional ideas or better, more actual versions of e-uae.


